import {
    DashboardContent,
    DashboardWrapper,
    EditionDetails,
    EditionsContainer,
    EditionsWrapper
} from "../../styled/Dashboard.styled";
import DashboardNavigation from "../../components/DashboardNavigation";
import {AdminH1, AdminH2, ScrollButton} from "../../styled/Common.styled";

function DashboardEditions() {
        return (
            <DashboardWrapper>
                <DashboardNavigation active={"home"}/>
                <DashboardContent>
                    <AdminH1>Bonjour, Mimoun.</AdminH1>
                    <AdminH2>Dernières éditions du journal <ScrollButton><i className="bi bi-chevron-right"></i></ScrollButton></AdminH2>
                    <EditionsWrapper>
                        <EditionsContainer>
                            <EditionDetails/>
                            <EditionDetails/>
                            <EditionDetails/>
                            <EditionDetails/>
                        </EditionsContainer>
                    </EditionsWrapper>
                </DashboardContent>
            </DashboardWrapper>
        );
}

export default DashboardEditions;
